var tipuesearch = {"pages": [{'title': 'About', 'text': '倉儲: https://github.com/40823216/cd2021 \n 小組網頁: stage1-bg15 \n \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0  stage2-bg7 \n \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0  stage3-bg6 \n \n', 'tags': '', 'url': 'About.html'}, {'title': '筆記', 'text': '', 'tags': '', 'url': '筆記.html'}, {'title': 'debug leo', 'text': '當在黑窗打leo時，會發生無法進入leo的狀況 \n \xa0 \xa0解決方法:需要再date/home_ipv4/.leo中加一個leoID.txt的檔案(檔案裡可以用任何的字串) \n \n', 'tags': '', 'url': 'debug leo.html'}, {'title': '無法git push', 'text': 'Git Push時。無法git push\xa0 \n \n 解決方法 \n (1)照著提示打git pull \n (2)就可以git push了 \n \n \n', 'tags': '', 'url': '無法git push.html'}, {'title': '網站404', 'text': 'github有推上去但網站顯示404 \n \n 解決方法 \n 1.點settings，找到github pages \n \n 2.將Source中的None改成Main \n \n', 'tags': '', 'url': '網站404.html'}, {'title': '協同問題', 'text': '1.按pull requests \n \n 2.按new\xa0pull requests(自己學號要在前面) \n \n', 'tags': '', 'url': '協同問題.html'}, {'title': 'stage1', 'text': '', 'tags': '', 'url': 'stage1.html'}, {'title': 'w1', 'text': '1.創建小組 倉儲 \n 2.與小組成員討論 \n \n \n \n 3.leo debug \n \xa0 \xa0解決方法:需要再date/home_ipv4/.leo中加一個leoID.txt的檔案(檔案裡可以用任何的字串) \n \n 4.w1_video \n \n', 'tags': '', 'url': 'w1.html'}, {'title': 'w2-3', 'text': '圖檔: 澆花器測試版.7z \n 1.小組討論 \n \n 2.使用使用solidworks繪圖 \n \xa0 \xa0(1)第一版: 澆花器測試版.7z \n \xa0 \xa0 \xa0 \xa0問題:因為第一版是設想用繩子.滑輪跟馬達來作動。但在使用CoppeliaSim時，找不到叫出繩子的方法。所以改用 曲柄搖桿系統來作動。 \n \xa0 \xa0 \xa0  \n \xa0 \xa0(2)第二版: 澆花器第二版.7z \n \n 使用coppeliasim模擬(失敗) \n \n 使用solidworks模擬 \n \n \n 3.video \n \n', 'tags': '', 'url': 'w2-3.html'}, {'title': 'w4', 'text': '圖檔: 澆花器第二版.7z \n 1.小組討論: \n \n 2.第三版: \n 第三版上視圖跟等角圖 \n \n 3.第三版模擬 \n \n \n 4.video \n \n', 'tags': '', 'url': 'w4.html'}, {'title': 'stage2', 'text': '', 'tags': '', 'url': 'stage2.html'}, {'title': 'w6', 'text': '1.小組討論 \n \n \n', 'tags': '', 'url': 'w6.html'}, {'title': 'w7', 'text': '', 'tags': '', 'url': 'w7.html'}, {'title': 'w7繪製零件圖', 'text': '零件圖載點: \n https://40823218.github.io/cd2021/content/%E9%9B%B6%E4%BB%B6%E5%9C%96.html \n 零件下載檔 \n 組合圖 \n \n 為了要將球發射出去，將兩圓筒最近距離設計為和乒乓球相同的40mm。 \n 圓筒 \n \n 底座和軌道 \n \n', 'tags': '', 'url': 'w7繪製零件圖.html'}, {'title': 'w7CoppeliaSim模擬', 'text': '因要將球射出，加大馬達扭力後，造成圓筒晃動。 \n \n', 'tags': '', 'url': 'w7CoppeliaSim模擬.html'}, {'title': 'w7小組討論', 'text': '\n \n', 'tags': '', 'url': 'w7小組討論.html'}, {'title': 'w8', 'text': '', 'tags': '', 'url': 'w8.html'}, {'title': 'w8繪製零件圖', 'text': '發 球機組合圖 \n \n 發球機主體 \n \n 圓盤:圓盤轉動，開孔使球能正確落下 \n \n \n 滾輪x2:將兩個滾輪快速轉動，使球發射出去 \n \n 8mm銷x2:用來定位主體跟滾輪的位置 \n \n 漏斗雛形:之後會挖中空，讓球放置其中 \n \n \n', 'tags': '', 'url': 'w8繪製零件圖.html'}, {'title': 'w8CoppeliaSim模擬', 'text': '\n \n 1.(4/12)圓盤的部分還有一些問題，開碰撞會彈走，所以還不能放球。 \n \n \n \n 2(4/15)這次就有放球了 \n \n', 'tags': '', 'url': 'w8CoppeliaSim模擬.html'}, {'title': 'w8小組討論', 'text': '\n \n \n \n \n \n', 'tags': '', 'url': 'w8小組討論.html'}, {'title': 'w9', 'text': '', 'tags': '', 'url': 'w9.html'}, {'title': 'w9繪製零件圖', 'text': '發球機.7z \n 0416 \n 1.更改籃子還是無法解決卡球的問題。 \n \n 0422 \n 1.將籃子改為管子，解決卡球的問題。 \n \n 2.新增噴嘴，為了使球能以最正確的方向噴出。 \n \n \n 3.主體+噴嘴組合圖 \n \n', 'tags': '', 'url': 'w9繪製零件圖.html'}, {'title': 'w9CoppeliaSim模擬', 'text': '模擬檔+stl.rar \n 改了很多次，但是求到第三顆還是不能順利的發射。 \n \n', 'tags': '', 'url': 'w9CoppeliaSim模擬.html'}, {'title': 'w9小組討論', 'text': '\n \n \n \n', 'tags': '', 'url': 'w9小組討論.html'}, {'title': 'stage3', 'text': '', 'tags': '', 'url': 'stage3.html'}, {'title': 'w10', 'text': '', 'tags': '', 'url': 'w10.html'}, {'title': '第一次討論', 'text': '\n \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': '第一次討論.html'}, {'title': 'tesk1', 'text': '參考 40823245 的程式，進而修改。 \n 將if/elif return 去掉 \n     if account == "40823231":      \n        return account + "-2"\n    elif account[0:3] == "407":\n        return "s" + account \n 改為date = [a.replace(\'需要修改的\' ， \'修改後的\'\xa0 ) for a in date] \n  data = [a.replace(\'40823231\',\'40823231-2\') for a in data]     \n    data = [a.replace(\'407\',\'s407\') for a in data]     \n \n 修改後的程式 \n def stu2b(account):\n return account\nteamb = []\n  \nwith open("stage3_2b.txt") as fh:     #讀取stage3_2b的檔案\n    data = fh.readlines()\n    data = [a.replace(\'40823231\',\'40823231-2\') for a in data]      #將40823231換成40823231-2\n    data = [a.replace(\'407\',\'s407\') for a in data]     #將有407的學號換成s407\n \nfor i in range(len(data)):     #數據中會有\\n跟\\t，將\\n跟\\t去除\n    group = data[i].rstrip("\\n").split("\\t")\n    teamb.append(group)\n      \noutput = ""    \nseperator = "-"*10 + "</br>"     #分隔號製作\n  \nfor i in teamb[0:]:    #小組 組長 其他六個組員\n    team = i[0]\n    leader = stu2b(i[1])\n    m1 = stu2b(i[3])\n    m2 = stu2b(i[5])\n    m3 = stu2b(i[7])\n    m4 = stu2b(i[9])\n    m5 = stu2b(i[11])\n    m6 = stu2b(i[13])\n \n          \n    leaderrepo = "<a href=\'http://github.com/" + leader + "/cd2021\'>" + leader + " repo</a>"    #組長以及組員的倉儲和網站\n    leadersite = "<a href=\'http://" + leader + ".github.io/cd2021\'>" + leader +  " site</a>"\n    m1repo = "<a href=\'http://github.com/" + m1 + "/cd2021\'>" + m1 + " repo</a>"\n    m1site = "<a href=\'http://" + m1 + ".github.io/cd2021\'>" + m1 +  " site</a>"\n    m2repo = "<a href=\'http://github.com/" + m2 + "/cd2021\'>" + m2 + " repo</a>"\n    m2site = "<a href=\'http://" + m2 + ".github.io/cd2021\'>" + m2 +  " site</a>"\n    m3repo = "<a href=\'http://github.com/" + m3 + "/cd2021\'>" + m3 + " repo</a>"\n    m3site = "<a href=\'http://" + m3 + ".github.io/cd2021\'>" + m3 +  " site</a>"\n    m4repo = "<a href=\'http://github.com/" + m4 + "/cd2021\'>" + m4 + " repo</a>"\n    m4site = "<a href=\'http://" + m4 + ".github.io/cd2021\'>" + m4 +  " site</a>"\n    m5repo = "<a href=\'http://github.com/" + m5 + "/cd2021\'>" + m5 + " repo</a>"\n    m5site = "<a href=\'http://" + m5 + ".github.io/cd2021\'>" + m5 +  " site</a>"\n    m6repo = "<a href=\'http://github.com/" + m6 + "/cd2021\'>" + m6 + " repo</a>"\n    m6site = "<a href=\'http://" + m6 + ".github.io/cd2021\'>" + m6 +  " site</a>"\n   \n  \n    teamrepo = "<a href=\'http://github.com/" + leader + "/" + team + "\'>" + team + " repo</a>"     #小組的倉儲含網站\n    teamsite =  "<a href=\'http://" + m1 + ".github.io/" + team + "\'>" + team +  " site</a>"\n  \n    output += teamrepo + " | " + teamsite + " | " +leaderrepo + " | " + leadersite + " | " +m1repo + " | " + m1site + " | " +m2repo + " | " + m2site + " | " +m3repo + " | " + m3site + " | " +m4repo + " | " + m4site + " | " +m5repo + " | " + m5site + " | " +m6repo + " | " + m6site \n      \n           \n    try:\n        m7 = stu2b(i[15])     #第七個組員\n    except:\n        m7 = ""\n    try:\n        m8 = stu2b(i[17])     #第八個組員\n    except:\n        m8 = ""\n         \n    if m7 != "":\n       m7repo = "<a href=\'http://github.com/" + m7 + "/cd2021\'>" + m7 + " repo</a>"     #如果有第七個組員會再加倉儲和網站沒有的話就空白\n       m7site = "<a href=\'http://" + m7 + ".github.io/cd2021\'>" + m7 +  " site</a>"  \n       output += " |  " + m7repo + "| " + m7site\n    else:\n        output += "" \n      \n    if m8 != "":\n       m8repo = "<a href=\'http://github.com/" + m8 + "/cd2021\'>" + m8 + " repo</a>"     #如果有第八個組員會再加倉儲和網站最後再加分隔線\n       m8site = "<a href=\'http://" + m8 + ".github.io/cd2021\'>" + m8 +  " site</a>"  \n       output += " |  " + m8repo + "| " + m8site + "<br />" + seperator\n    else:\n        output += "<br />" + seperator\n  \n  \nprint(output)     #輸出 \n stage3-bg1 repo  |  stage3-bg1 site  |  40823245 repo  |  40823245 site  |  40823251 repo  |  40823251 site  |  40823208 repo  |  40823208 site  |  40823213 repo  |  40823213 site  |  40823232 repo  |  40823232 site  |  40823234 repo  |  40823234 site  |  40823235 repo  |  40823235 site  |  40823246 repo |  40823246 site ---------- stage3-bg2 repo  |  stage3-bg2 site  |  40823217 repo  |  40823217 site  |  40823201 repo  |  40823201 site  |  40823209 repo  |  40823209 site  |  40823210 repo  |  40823210 site  |  40823206 repo  |  40823206 site  |  40823207 repo  |  40823207 site  |  40823223 repo  |  40823223 site  |  40823224 repo |  40823224 site ---------- stage3-bg3 repo  |  stage3-bg3 site  |  40823236 repo  |  40823236 site  |  40823202 repo  |  40823202 site  |  40823203 repo  |  40823203 site  |  40823212 repo  |  40823212 site  |  40823219 repo  |  40823219 site  |  40823222 repo  |  40823222 site  |  40823231-2 repo  |  40823231-2 site  |  40823244 repo |  40823244 site ---------- stage3-bg4 repo  |  stage3-bg4 site  |  40823239 repo  |  40823239 site  |  s40723140 repo  |  s40723140 site  |  s40723128 repo  |  s40723128 site  |  s40723139 repo  |  s40723139 site  |  s40723106 repo  |  s40723106 site  |  s40723135 repo  |  s40723135 site  |  s40723143 repo  |  s40723143 site  |  s40723215 repo |  s40723215 site ---------- stage3-bg5 repo  |  stage3-bg5 site  |  40823221 repo  |  40823221 site  |  40823204 repo  |  40823204 site  |  40823205 repo  |  40823205 site  |  40823220 repo  |  40823220 site  |  40823228 repo  |  40823228 site  |  40823237 repo  |  40823237 site  |  40823242 repo  |  40823242 site  |  40823250 repo |  40823250 site  |  40832244 repo |  40832244 site ---------- stage3-bg6 repo  |  stage3-bg6 site  |  40823225 repo  |  40823225 site  |  40823214 repo  |  40823214 site  |  40823218 repo  |  40823218 site  |  40823211 repo  |  40823211 site  |  40823248 repo  |  40823248 site  |  40823247 repo  |  40823247 site  |  40823216 repo  |  40823216 site  |  40823238 repo |  40823238 site ---------- stage3-bg7 repo  |  stage3-bg7 site  |  40623144 repo  |  40623144 site  |  40823233 repo  |  40823233 site  |  s40723224 repo  |  s40723224 site  |  40823241 repo  |  40823241 site  |  40423155 repo  |  40423155 site  |  40823227 repo  |  40823227 site  |  s40723233 repo  |  s40723233 site ---------- \n \n', 'tags': '', 'url': 'tesk1.html'}, {'title': '程式模擬', 'text': '上網找的資料顯示coppeliasim上有一個編輯程式的選項 \n 參考資料: https://zhuanlan.zhihu.com/p/105960079 \n 4/27(二)因為繪圖部分還沒畫好，今天暫時用coppeliasim裡的機械手臂模型來模擬。 \n 設定的主體上連結每個零件，各零件之間有可以旋轉的軸，以及連結的命令區塊 \n 下圖為參考的機械手臂: \n \n 這是機械手臂的零件圖: \n \n', 'tags': '', 'url': '程式模擬.html'}, {'title': 'w11', 'text': '', 'tags': '', 'url': 'w11.html'}, {'title': '第二次討論', 'text': '\n \n \n \n', 'tags': '', 'url': '第二次討論.html'}, {'title': '直播影片', 'text': '40823216直播影片 \n \n', 'tags': '', 'url': '直播影片.html'}, {'title': 'w11程式模擬', 'text': '根據上網找的資料，發現COPPELIASIM的程式編譯語言為LUA，但仍可透過改變設定，來使用其他語言編譯。 \n \n 以下為參考資料: \n https://blog.csdn.net/qq_29696095/article/details/104406971 https://blog.csdn.net/qq_29696095/article/details/104474081 https://www.coppeliarobotics.com/helpFiles/en/inverseKinematicsTutorial.htm \n http://mde.tw/cd2021/downloads/V-REP%20Lecture.pdf http://hades.mech.northwestern.edu/index.php/CoppeliaSim_Introduction https://www.coppeliarobotics.com/helpFiles/index.html http://mde.tw/cd2021/content/V-rep.html \n', 'tags': '', 'url': 'w11程式模擬.html'}, {'title': 'w12', 'text': '', 'tags': '', 'url': 'w12.html'}, {'title': 'w13', 'text': 'rodoDK測試 \n 將老師所要求的機械手臂取放物件專案學習流程先在roboDK中先行模擬 \n', 'tags': '', 'url': 'w13.html'}, {'title': 'w14', 'text': '', 'tags': '', 'url': 'w14.html'}, {'title': 'w15', 'text': '', 'tags': '', 'url': 'w15.html'}, {'title': 'w16', 'text': '按照要做MTB_robot 的取放方塊流程規劃 \n 1.先在onshape上繪圖: \n 第一版網址: onshape網址 \xa0 \n 第一版stl檔: MTB_robot_stl \n \n 第二版網址:  onshape網址 \n 第二版stl壓縮檔: MTB_robot_第二版 \n \n onshape_影片 \n \n 2. 建立 CoppeliaSim 4.1.0 MTB robot 場景 \n 3. 手臂末端加入 components-gripper-suction pad 吸盤 \n 4. 逆向運動學函式 \n \n 主程式+副程式(moving) \n function moving(x,y)\n  a=0.4\n  b=0.4\n  c=math.pow((math.pow(x,2)+math.pow(y,2)),0.5)\n  s=(a+b+c)/2\n  area=math.pow((s*(s-a)*(s-b)*(s-c)),0.5)\n  h=area/(2*c)\n  deg1_base=math.atan(x/y)\n  if x<0 and y<0 then\n     deg1_base=deg1_base+math.pi\n  end\n  deg1_tri=math.asin(h/a)\n  deg1=deg1_base+deg1_tri\n  deg2=math.pi-(0.5*math.pi-deg1_tri)-math.acos(h/b)\n  deg3=deg2-deg1\n  sim.setJointTargetPosition(joint01,deg1)\n  sim.setJointTargetPosition(joint02,-deg2)\n  sim.setJointTargetPosition(joint03,deg3)\nend\n\nfunction sysCall_threadmain()\n  t=1                                                             //延遲時間T=1\n  joint01=sim.getObjectHandle(\'joint1\')           //設定軸得名稱和是哪個軸\n  joint02=sim.getObjectHandle(\'joint2\')\n  joint03=sim.getObjectHandle(\'joint3\')\n  jointz=sim.getObjectHandle(\'jointz\')\n  sim.setJointTargetPosition(joint01,0)            //將所有軸都歸0\n  sim.setJointTargetPosition(joint02,0)\n  sim.setJointTargetPosition(joint03,0)\n  sim.setJointTargetPosition(jointz,0)\n  sim.setIntegerSignal("pad_switch",1)           //吸盤吸住的程式\n  sim.setJointTargetPosition(jointz,-0.035)      //吸盤下降3.5mm\n  sim.wait(t)                                                 //延遲時間(t)\n  sim.setJointTargetPosition(jointz,0)         \n  sim.wait(t)\n  while sim.getSimulationState()~=sim.simulation_advancing_abouttostopre do   //lua迴圈程式\n  moving(0.2,0.7)                                        //所求的x.y座標\n  sim.wait(t)\n  sim.setIntegerSignal("pad_switch",0)         \n  sim.wait(t)\n  sim.setIntegerSignal("pad_switch",1)\n  sim.setJointTargetPosition(jointz,-0.035)\n  sim.wait(t)\n  sim.setJointTargetPosition(jointz,0)\n  sim.wait(t)\n  moving(-0.3,-0.55)\n  sim.wait(t)\n  sim.setIntegerSignal("pad_switch",1)\n  sim.wait(t)\n  sim.setIntegerSignal("pad_switch",1)\n  sim.setJointTargetPosition(jointz,-0.035)\n  sim.wait(t)\n  sim.setJointTargetPosition(jointz,0)\n  sim.wait(t)\n  end\n  \nend\n\nfunction sysCall_cleanup()\n    -- Put some clean-up code here\nend\n\n-- See the user manual or the available code snippets for additional callback functions and details\n \n 吸盤程式 \n --參考40823214的程式\nfunction sysCall_init() \n    objectHandle=sim.getObjectHandle(\'suctionPad\')\n    sim.setUserParameter(objectHandle,\'@enable\',\'\')\n    modelBase=sim.getObjectAssociatedWithScript(sim.handle_self)\n    robotBase=modelBase\n    while true do\n        robotBase=sim.getObjectParent(robotBase)\n        if robotBase==-1 then\n            robotName=\'Dobot\'\n            break\n        end\n        robotName=sim.getObjectName(robotBase)\n        suffix,suffixlessName=sim.getNameSuffix(robotName)\n        if suffixlessName==\'Dobot\' then\n            break\n        end\n    end\n\n    s=sim.getObjectHandle(\'suctionPadSensor\')\n    l=sim.getObjectHandle(\'suctionPadLoopClosureDummy1\')\n    l2=sim.getObjectHandle(\'suctionPadLoopClosureDummy2\')\n    b=sim.getObjectHandle(\'suctionPad\')\n    suctionPadLink=sim.getObjectHandle(\'suctionPadLink\')\n    local gripperBase=sim.getObjectAssociatedWithScript(sim.handle_self)\n\n    infiniteStrength=sim.getScriptSimulationParameter(sim.handle_self,\'infiniteStrength\')\n    maxPullForce=sim.getScriptSimulationParameter(sim.handle_self,\'maxPullForce\')\n    maxShearForce=sim.getScriptSimulationParameter(sim.handle_self,\'maxShearForce\')\n    maxPeelTorque=sim.getScriptSimulationParameter(sim.handle_self,\'maxPeelTorque\')\n\n    sim.setLinkDummy(l,-1)\n    sim.setObjectParent(l,b,true)\n    m=sim.getObjectMatrix(l2,-1)\n    sim.setObjectMatrix(l,-1,m)\nend\n\nfunction sysCall_cleanup() \n    sim.setLinkDummy(l,-1)\n    sim.setObjectParent(l,b,true)\n    m=sim.getObjectMatrix(l2,-1)\n    sim.setObjectMatrix(l,-1,m)\nend \n\nfunction sysCall_sensing() \n    parent=sim.getObjectParent(l)\n    local sig=sim.getIntegerSignal("pad_switch")\n    if (not sig) or (sig==0) then\n        if (parent~=b) then\n            sim.setLinkDummy(l,-1)\n            sim.setObjectParent(l,b,true)\n            m=sim.getObjectMatrix(l2,-1)\n            sim.setObjectMatrix(l,-1,m)\n        end\n    else\n        if (parent==b) then\n            index=0\n            while true do\n                shape=sim.getObjects(index,sim.object_shape_type)\n                if (shape==-1) then\n                    break\n                end\n                local res,val=sim.getObjectInt32Parameter(shape,sim.shapeintparam_respondable)\n                if (shape~=b) and (val~=0) and (sim.checkProximitySensor(s,shape)==1) then\n                    -- Ok, we found a respondable shape that was detected\n                    -- We connect to that shape:\n                    -- Make sure the two dummies are initially coincident:\n                    sim.setObjectParent(l,b,true)\n                    m=sim.getObjectMatrix(l2,-1)\n                    sim.setObjectMatrix(l,-1,m)\n                    -- Do the connection:\n                    sim.setObjectParent(l,shape,true)\n                    sim.setLinkDummy(l,l2)\n                    break\n                end\n                index=index+1\n            end\n        else\n            -- Here we have an object attached\n            if (infiniteStrength==false) then\n                -- We might have to conditionally beak it apart!\n                result,force,torque=sim.readForceSensor(suctionPadLink) -- Here we read the median value out of 5 values (check the force sensor prop. dialog)\n                if (result>0) then\n                    breakIt=false\n                    if (force[3]>maxPullForce) then breakIt=true end\n                    sf=math.sqrt(force[1]*force[1]+force[2]*force[2])\n                    if (sf>maxShearForce) then breakIt=true end\n                    if (torque[1]>maxPeelTorque) then breakIt=true end\n                    if (torque[2]>maxPeelTorque) then breakIt=true end\n                    if (breakIt) then\n                        -- We break the link:\n                        sim.setLinkDummy(l,-1)\n                        sim.setObjectParent(l,b,true)\n                        m=sim.getObjectMatrix(l2,-1)\n                        sim.setObjectMatrix(l,-1,m)\n                    end\n                end\n            end\n        end\n    end\nend  \n 5. Python remote API 逆向運動學函式 \n \n Python remote API 程式 \n import sim as vrep\nimport math\nimport random\nimport time\nimport math\n \ndef moving(x,y):  \n        a=0.4\n        b=0.4\n        c=math.pow((math.pow(x,2)+math.pow(y,2)),0.5)\n        s=(a+b+c)/2\n        area=math.pow((s*(s-a)*(s-b)*(s-c)),0.5)\n        h=area/(2*c)\n        deg1_base=math.atan(x/y)\n        if x<0 and y<0 :\n            deg1_base=deg1_base+math.pi\n        deg1_tri=math.asin(h/a)\n        deg1=deg1_base+deg1_tri\n        deg2=math.pi-(0.5*math.pi-deg1_tri)-math.acos(h/b)\n        deg3=deg2-deg1\n        vrep.simxSetJointTargetPosition(clientID,joint01,deg1,opmode)\n        vrep.simxSetJointTargetPosition(clientID,joint02,-deg2,opmode)\n        vrep.simxSetJointTargetPosition(clientID,joint03,deg3,opmode)\n         \n \nprint (\'Start\')\n  \nvrep.simxFinish(-1)\n  \nclientID = vrep.simxStart(\'127.0.0.1\', 19997, True, True, 5000, 5)\n \nif clientID != -1:\n    print (\'Connected to remote API server\')\n \n    res = vrep.simxAddStatusbarMessage(\n        clientID, "This is teach by 40823216 ",\n        vrep.simx_opmode_oneshot)\n    if res not in (vrep.simx_return_ok, vrep.simx_return_novalue_flag):\n        print("Could not add a message to the status bar.")\n \n \n    opmode = vrep.simx_opmode_oneshot_wait\n    STREAMING = vrep.simx_opmode_streaming\n \n \n    vrep.simxStartSimulation(clientID, opmode)\n    ret,joint01=vrep.simxGetObjectHandle(clientID,"joint1",opmode)\n    ret,joint02=vrep.simxGetObjectHandle(clientID,"joint2",opmode)\n    ret,joint03=vrep.simxGetObjectHandle(clientID,"joint3",opmode)\n    ret,jointz=vrep.simxGetObjectHandle(clientID,"jointz",opmode)\n     \n    vrep.simxSetJointTargetPosition(clientID,joint01,0,opmode)\n    vrep.simxSetJointTargetPosition(clientID,joint02,0,opmode)\n    vrep.simxSetJointTargetPosition(clientID,joint03,0,opmode)\n    vrep.simxSetIntegerSignal(clientID,"pad_switch",1,opmode)\n    vrep.simxSetJointTargetPosition(clientID,jointz,-0.032,opmode)\n    time.sleep(1)\n    vrep.simxSetJointTargetPosition(clientID,jointz,0,opmode)\n    while True:\n        moving(0.2,0.7)\n        time.sleep(2)\n        vrep.simxSetIntegerSignal(clientID,"pad_switch",0,opmode)\n        time.sleep(2)\n        vrep.simxSetIntegerSignal(clientID,"pad_switch",1,opmode)\n        vrep.simxSetJointTargetPosition(clientID,jointz,-0.032,opmode)\n        time.sleep(2)\n        vrep.simxSetJointTargetPosition(clientID,jointz,0,opmode)\n        moving(-0.3,-0.55)\n        time.sleep(2)\n        vrep.simxSetIntegerSignal(clientID,"pad_switch",0,opmode)\n        time.sleep(2)\n        vrep.simxSetIntegerSignal(clientID,"pad_switch",1,opmode)\n        vrep.simxSetJointTargetPosition(clientID,jointz,-0.032,opmode)\n        time.sleep(2)\n        vrep.simxSetJointTargetPosition(clientID,jointz,0,opmode) \n', 'tags': '', 'url': 'w16.html'}, {'title': 'w5', 'text': '\n 設計二甲上台報告時間: \n \n 模擬 <<  Previous', 'tags': '', 'url': 'w5.html'}]};